INSERT INTO `engine_vars` VALUES (1,1,'introtekst','<p>From now on you can <!-- google_ad_section_start -->create free web banners with our <strong>banner generator</strong>. Why you ask? Well that is quite simple to answer: Bannersketch.com is THE totally free online banner creator!<br /><br />=========<br /><font size=\"2\" color=\"#FF0000\"><strong>HOT NEWS!</strong></font><br />We just launched our the new release of this BannerSketch website. Give it a try and visit this test release at </p><div align=\"center\"><font color=\"#FF0000\"><strong><font size=\"3\"><a href=\"http://www.bannersketch.eu\" title=\"Wauw! Check out our new release at bannersketch.eu!\">BannerSketch.eu</a></font></strong></font></div><br />How does it feel? What do you think, let&#39;s upgrade and release it on this BannerSketch.com domain?<br />========= <br /><br />In just a few minutes you can, without any webdesign knowledge, make your own web banner. Our high-quality professional online banner creator has unprecedented features. Online internet banners can be made with our templates combined with your own banner text lines. Or upload your own images and choose the banner size you like. With a little effort you can make the most beautiful web banner creations. <p>&nbsp;</p><br /> Our Bannersketch service is completely free of charge and you can use these web banners for your MySpace and Hyves account(s) or of course your own website or blog!<br /><br />  Don&rsquo;t doubt, try it! You can receive your newly made web banner in your e-mailbox today and use it to start promoting your web presence!'),(2,1,'maintenance',''),(10,1,'linkpartners','Partners'),(4,1,'faqtekst','Frequently Asked Questions'),(5,1,'faqvraag','Questions'),(8,1,'faqantwoord','Answers'),(9,1,'contact','Contact us'),(11,1,'text',''),(12,1,'ol_underline','Here you can configure your text underline settings.'),(13,1,'ol_schaduw','Here you can configure your shadow settings.'),(14,1,'ol_rand','Here you can configure your outline/text border settings.'),(15,1,'ol_font','Here you can define a font for this line.'),(16,1,'ol_refresh_color','Update/Refresh new text color.'),(17,1,'ol_draaien','Rotate your text clockwise or non-clockwise.'),(18,1,'ol_save','Save / Backup your current settings for later use!'),(19,1,'ol_frames','Here you can change your frame count, 1 frame resembles a static banner (no moving), more then 1 frame resembles a gif animation.'),(20,1,'first_intro','<p>Please select a solution above</p><p><strong>Warning</strong>:</p><p>If you&#39;ve already made a banner, all your settings will be lost and the generator will be resetted when you click one of the options above!</p>'),(21,1,'lnk_avatars','<p>Want to create avatars? Click here for sizes!</p>'),(22,1,'faqtekst_1','Frequently'),(23,1,'faqtekst_2','asked questions'),(24,1,'jfkhsafk',''),(25,1,'contact_1','Contact'),(26,1,'contact_2','us'),(27,1,'prebuild_addby','Powered&nbsp;by'),(28,1,'prebuild_addon','Template added on'),(29,1,'prebuild_name','Name'),(30,1,'prebuild_more','More templates:'),(31,1,'lutekst_1','Last'),(32,1,'lutekst_2','updates'),(33,1,'liu_1','Link'),(34,1,'liu_2','us'),(35,1,'favorieten_url','http://www.bannersketch.com'),(36,1,'favorieten_titel','Bannersketch.com - Free banner maker'),(37,1,'favorieten','Add to favourites'),(38,1,'help_firstblock','Select the top and bottom color that you want to have for your background. When you&#39;ve selected the desired colors you can press the green arrows to save the colors to your image.'),(39,1,'ol_textcolor','To edit the color of a text simply click on this field. This will open up a&nbsp;color pallet which you can use to select colors. Select the refresh button when you have selected your desired color, you will immediatly see the effect in your banner. You can leave the color pallet open and select another color field to continue.'),(40,1,'ol_color','To edit the color of a&nbsp;background simply click on this field. This will open up a&nbsp;color pallet which you can use to select colors. Select the refresh button when you have selected your desired color, you will immediatly see the effect in your banner. You can leave the color pallet open and select another color field to continue.'),(42,1,'compatitable','<p>-&nbsp;Our online generator/maker&nbsp;also provides you, more than 1372 prebuild Banner Templates&nbsp;<a href=\"http://www.bannersketch.com/?pid=generator&amp;pag=1&amp;opt=1\" title=\"Prebuild Banner templates\"><br /></a>-&nbsp;Make: Extended Myspace network banners, Web banner, Headers, <span style=\"text-decoration: none\">Avatars,</span> buttons and even business cards.<br /><br /><font color=\"#848f03\"><img src=\"http://www.bannersketch.com/files/media/pijl.gif\" border=\"0\" width=\"5\" height=\"9\" />&nbsp;</font><a href=\"http://www.bannersketch.com/?pid=generator&amp;pag=1&amp;opt=2\" title=\"Start Now!\"><font color=\"#848f03\"><strong>Start now!</strong></font></a><font color=\"#848f03\"><br /><img src=\"http://www.bannersketch.com/files/media/pijl.gif\" border=\"0\" width=\"5\" height=\"9\" /> </font><a href=\"http://www.bannersketch.com/index.php?pid=getprevious\"><font color=\"#848f03\"><strong>Retrieve your previously generated banners!</strong></font></a></p>'),(41,1,'confirmation','Are you sure you wish to use this type of banner?'),(43,1,'linkpartners_ylh','Want your site in this list? Send us a mail! Click here!'),(44,1,'prebuild_category','Category'),(45,1,'gp_1','Get'),(46,1,'gp_2','Your previously generated banners!');
