INSERT INTO `modules_faq` VALUES (1,1,'What is Bannersketch.com for?','On BannerSketch.com you can online, without any knowledge of designing, make your own advertising material. Think about making your own: banners, headers, footers, business cards or even avatars.',1),(2,2,'What are empty templates?','Empty templates are templates without a prebuild background. You can create your own background.',8),(3,2,'How do I make a banner background in one colour?','You can do this by selecting both the colour fields, in the tab background, in the same colour.	 \r\n',20),(4,2,'What sorts of banner can I make on BannerSketch.com?','There are two sorts of banners. You have the choice between stationary and moving banners.',5),(5,2,'Is it possible to make a moving banner?','You can select in the tab â€˜Framesâ€™ and â€˜Textâ€™ how many frame you would like. The standard is a stationary banner, from two frames on you are working with a moving banner. Three frames is mostly used for moving banners.',6),(6,2,'What are Frames?','With using frames your banner gets a moving effect. Frames are layers that are played after each other. On this way the established texts are played after each other. The speed is also to determine, on the moment you choose for multiple frames there will appear a window in which you can determine the speed. 	 \r\n',7),(7,2,'Can I give up my own banner size?','Yes, this is possible with the empty templates. You can adjust the Width and Height and press set afterwards.',9),(8,2,'Can I use my own images as a background for my banners?','Yes this is possible, if you first make the choice about what format you want. After that you come on the tab colours/background. Here you have the choice between background colours or uploading your own image.',10),(9,2,'What sort of images can I upload?','You can make use of the following files: .jpg; .gif or .bmp. All other sorts will be rejected by our system.',12),(10,2,'How do I change the font type?','Before the text line thereâ€™s an icon with an A. If you click on this icon youâ€™ll get a window with all our letter types alphabetical classified. With a double mouseclick the font is selected.',13),(11,2,'How do I determine which area of my image I want to use as the banner background?','If your image is uploaded to our server youâ€™ll see an lightened up area covering your image. By dragging this area with the left mousebutton youâ€™ll determine which part you want to use for your banner.  Then you walk trough stap 1 and 2.',11),(12,2,'How do I apply shadows to my text?','Behind the text Lines there are three icons. With the first icon you can apply shadow to the text line. You can also apply the thickness and colour with it.',14),(13,2,'How do I outline my text?','Behind the text Lines there are three icons. With the second icon you can outline the text line. You can also apply the thickness and colour of the line with it.',15),(15,2,'Can I use more then 3 lines of text?','Yes that is possible. Above the text Lines there are two drop down menuâ€™s. With the belowest you determine how many text Lines you would like.',19),(16,2,'Is it possible to use any other colours in the generator?','Yes that is possible. In the colour fields you can put HTML font codes. However it is also possible to make every wanted colour with the colour picker. When using the tab colour slider within the picker, you have to click on the wanted colour when reaching these.',18),(17,2,'Is it possible to rotate the text in another direction?','Yes that is possible. Behind the rotator is an icon. When you click on this icon the rotation goes clockwise.	 ',17),(18,2,'Is it possible to continue with making my banner at a later time?','Yes this is possible. At the right of every page thereâ€™s a function â€˜Save current settingsâ€™. When you make use of this function you will get a code. If you at a later time put this code in the tab â€˜load previous settingsâ€™ youâ€™ll data will be received. \r\n\r\n<u>Be careful your data will online be saved for 5 days!</u>',21),(19,2,'Are the made banners hosted on BannerSketch.com?','To keep the server load as low as possible weâ€™ve chosen not to host any banners. 	 ',22),(20,2,'Where can I get my banner hosted?','You can host the banner youâ€™ve made on your own server. Often you have a webspace to your arrangement by your internet provider where you can upload youâ€™re banner. There are also free hosting serviced where your banner can be hosted for free. A good example of one of these services is <a href=\"http://imageshack.us\" target=\"_blank\"><img src=\"http://imageshack.us/img/imageshackbanner.gif\" border=\"0\" /></a>',23),(21,2,'Why do I receive my banner per e-mail?','You receive the banner per e-mail because of the following reasons:\r\n1. We want to make sure the banner is delivered rightly. People often forget where they have saved their banner. The definitive banner is also made, without watermark, at the moment it is send to you.\r\n2. On the site the banners are shown with a watermark to prevent our templates being copied. ',24),(22,2,'What does a banner on BannerSketch.com cost me?','A banner made on BannerSketch.com is entirely free of charge. Even better, it will save you money because you donâ€™t have to make use of expensive designing companies. Another advantage compared with other banner services is that our banners are delivered without any publicity watermarks.',2),(23,2,'What to do if my question isnâ€™t in the FAQ?','If there is no answer to your question in our FAQ, please contact us trough the contact form. When we received a question more then once we will place it in our FAQ.',29),(24,2,'How is it possible that BannerSketch.com completely free is?','By keeping our costs as low as possible and putting promotions on different spots on the site. This way we try to cover our costs.',3),(25,2,'Is it possible, as a designer, to deliver non-profit banner template?','Yes, we really appreciate this. You can contact us for more information. As counter-payment your name will be mentioned with the delivery of the banner (when someone has chosen for your template). We would like to attend you that after delivering the template this will be in full ownership of BannerSketch.com.',25),(26,2,'What information do I receive in a newsletter service?','Youâ€™ll receive update information about BannerSketch.com. In example when new templates are placed.',26),(27,2,'Are there promotions in the newsletters?','To cover the costs of this free service we will occasionally use some spare space in the newsletters for promotion. We are our possible sponsors most grateful.',27),(28,2,'How do I unsubscribe from the newsletter service?','With the special link at the end of every newsletter you can unsubscribe.',28),(29,1,'Am I allowed to link to www.BannerSketch.com and/or use your banners?','This is highly appreciated. The free banner generator service is after all here for everyone. Our slogan is: â€˜When youâ€™re satisfied tell others, or tell us!',29),(30,1,'BannerSketch.com is a great site. How can I help?','Bannersketch.com is free of use for everyone. You can help us by telling\r\nother people about Bannersketch, the free banner maker. You can use <a href=\"http://www.bannersketch.com/?pid=link_us\">banner</a> and <a href=\"http://www.bannersketch.com/?pid=link_us\">linkcodes</a> to link to Bannersketch. Last but not least: don\'t forget\r\nour sponsors.\r\n<form action=\"https://www.paypal.com/cgi-bin/webscr\" method=\"post\">\r\n<input type=\"hidden\" name=\"cmd\" value=\"_xclick\">\r\n<input type=\"hidden\" name=\"business\" value=\"donate@bannersketch.com\">\r\n<input type=\"hidden\" name=\"item_name\" value=\"Free Banner Service Donate\">\r\n<input type=\"hidden\" name=\"no_shipping\" value=\"0\">\r\n<input type=\"hidden\" name=\"no_note\" value=\"1\">\r\n<input type=\"hidden\" name=\"currency_code\" value=\"USD\">\r\n<input type=\"hidden\" name=\"tax\" value=\"0\">\r\n<input type=\"hidden\" name=\"lc\" value=\"US\">\r\n<input type=\"hidden\" name=\"bn\" value=\"PP-DonationsBF\">\r\n<input type=\"image\" src=\"http://www.bannersketch.com/paypaldonate.png\" border=\"0\" name=\"submit\" alt=\"Make payments with PayPal - it\'s fast, free and secure!\">\r\n<img alt=\"\" border=\"0\" src=\"https://www.paypal.com/en_US/i/scr/pixel.png\" width=\"1\" height=\"1\">\r\n</form>',31),(31,2,'How can i get my lines under eachother?','The lines can be put under eachother by swifting the buttons in de \'coordinates\' section. For each line there is a button. You can swift them horizontal en vertical.\r\nThe X stands for the horizontal movement and the Y stand for the vertical\r\nmovement.\r\n',30),(32,2,'How do I make text bold?','Use the option: text border/outline settings.\r\nAnd set the color the same as your text.',15),(33,2,'How can I capture the attention of my visitors with my banner?','You should emphasize on the purpose of your business. For example when dealing with an affiliate <a href=\"http://www.pokerjunkie.com/poker-sites.php\" target=\"_blank\">poker site</a>, make sure to mention the word -poker- on your banner.',8);
